/**
 * This Component is used for Show Combine array
 *
 */
import React, { useEffect, useState } from "react";
import { connect } from "react-redux";
import { fetchCountryData } from "../../services/api";
import axios from "axios";
import { useHistory } from "react-router-dom";

const mapStateToProps = ({ dispatch, user }) => ({
  dispatch: dispatch,
  countryName: user.countryName,
});

const UserWeather = ({ dispatch, countryName, user }) => {
  const history = useHistory();

  const [weatherData, setWeatherData] = useState({});

  useEffect(() => {
    debugger;
    console.log(user);
    axios
      .get(
        `http://api.weatherstack.com/current?access_key=0f276e833b2dc84c8bc71fda875dfcff&query='New Delhi'`
      )
      .then((res) => {
        debugger;
        setWeatherData(res.data.current);
      });
    debugger;
  }, []);

  return (
    <div>
      <h3 className="test-center">Weather Details</h3>
      <div className="card country-card">
        <img
          className="card-img-top country-img"
          src={weatherData.weather_icons}
          alt="Card image cap"
        />
        <div className="card-body">
          <p className="card-text">Temperature : {weatherData.temperature}</p>
          <p className="card-text">Wind Speed : {weatherData.wind_speed}</p>
          <p className="card-text">Precip : {weatherData.precip}</p>
        </div>
      </div>
    </div>
  );
};

export default connect(mapStateToProps)(UserWeather);
